import React from 'react'
import { useForm } from "react-hook-form";
const AddPaciente = () => {
  const { register, handleSubmit, watch, formState: { errors } } = useForm();
  const addPaciente=(data)=>console.log(data)



  return (
    <form onSubmit={handleSubmit(addPaciente)} className='flex flex-col bg-white w-auto p-4 '>
        <label className='mt-4 mb-1' htmlFor="Cedula">Cedula</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Cedudla" id="Cedula" minLength={10} maxLength={10} placeholder='Cedula del Paciente'
        {...register('Cedula',{
          required:{
            value:true,
            message:"Numero de Cedula es Obbligatrio"
          },
          pattern:{
            value:'[0-9]{10}',
            message:'Solo numeros'
          }
        })} />  
        {errors.Cedula && <span>EEE</span> }
