        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre" minLength={1} maxLength={200} placeholder='Nombre del Paciente'/>
        <input className='m-auto w-2/3 my-6' type="submit" value="Agregar" />
    </form>
  )
}

export default AddPaciente
